import { default as React } from 'react';

import * as Routes from '../../routes';

import picture from '../../assets/pexels-photo-880459.jpeg';
import './prepages.scss';

import { Logo, FooterWithTextAndBtn } from '../../components'

const WelcomePage = () => {
	return (
		<div className="welcome">
			<div className="welcome__main">
				<Logo hasSlogan={true} />
			</div>

			<img id="background" alt="picture_for_background" src={picture} />
			<FooterWithTextAndBtn main_text={'Get started with Shop-it'} isTextBig={true} secondairy_text={'Continue'} route_btn={Routes.LOGIN} />
		</div>
	);
};

export default WelcomePage;
